import React,{ useEffect } from "react";
// import { Link } from "react-router-dom";
import axios from 'axios';

function Blog() {
    useEffect(() => {
        document.title = 'from';
        
        async function getdata() {
            const res = await axios.get(`http://localhost:5000/api/vacancy`,{
                params: {
                    Number: "100",
                    Id: "101",
                    userName: "11",
                    credential: "Test"
                  }
            });
            console.log(res);
            console.log("res");
        }
        getdata()
    });


    return (
        <>
            <br/>
            <br/>
            <br/>
            <br/>
            <h1>from</h1>
        </>
    )
}

export default Blog
